import React, { useState, useEffect } from 'react';
import styled from 'styled-components';

const Container = styled.div`
  display: flex;
  flex-direction: column;
  height: 100%;
  width: 100%;
`;

const Header = styled.div`
  padding: 10px;
  background-color: #f5f5f5;
  font-weight: bold;
  border-bottom: 1px solid #ccc;
  display: flex;
  justify-content: space-between;
  align-items: center;
`;

const PathDisplay = styled.div`
  overflow-x: auto;
  white-space: nowrap;
  flex: 1;
  padding-right: 10px;
`;

const RefreshButton = styled.button`
  background-color: #4285f4;
  color: white;
  border: none;
  border-radius: 5px;
  padding: 5px 10px;
  cursor: pointer;

  &:hover {
    background-color: #3367d6;
  }
`;

const FileListContainer = styled.div`
  flex: 1;
  overflow-y: auto;
  padding: 10px;
`;

const FileItem = styled.div`
  padding: 8px;
  border-bottom: 1px solid #eee;
  cursor: pointer;
  display: flex;
  align-items: center;

  &:hover {
    background-color: #f0f0f0;
  }
`;

const FolderIcon = styled.span`
  margin-right: 10px;
  color: #FFC107;
`;

const FileIcon = styled.span`
  margin-right: 10px;
  color: #4285f4;
`;

const FileContent = styled.div`
  flex: 1;
  overflow-y: auto;
  padding: 10px;
  font-family: monospace;
  white-space: pre-wrap;
  border-top: 1px solid #ccc;
`;

// Mock file system - in a real app, this would come from an API
const mockFileSystem = {
  name: 'repo',
  type: 'folder',
  children: [
    {
      name: 'src',
      type: 'folder',
      children: [
        { name: 'index.js', type: 'file', content: 'console.log("Hello World!");' },
        { name: 'app.js', type: 'file', content: 'import React from "react";\n\nfunction App() {\n  return <div>Hello World</div>;\n}\n\nexport default App;' }
      ]
    },
    {
      name: 'package.json',
      type: 'file',
      content: '{\n  "name": "my-app",\n  "version": "1.0.0"\n}'
    },
    {
      name: 'README.md',
      type: 'file',
      content: '# My Project\n\nThis is a sample project.'
    }
  ]
};

const FileViewer = () => {
  const [currentPath, setCurrentPath] = useState([]);
  const [currentFolder, setCurrentFolder] = useState(mockFileSystem);
  const [selectedFile, setSelectedFile] = useState(null);

  useEffect(() => {
    navigateToPath(currentPath);
  }, [currentPath]);

  const navigateToPath = (path) => {
    let folder = mockFileSystem;

    for (const folderName of path) {
      const foundFolder = folder.children.find(
        item => item.name === folderName && item.type === 'folder'
      );

      if (foundFolder) {
        folder = foundFolder;
      } else {
        // Path not found, reset to root
        setCurrentPath([]);
        setCurrentFolder(mockFileSystem);
        return;
      }
    }

    setCurrentFolder(folder);
  };

  const handleFileClick = (file) => {
    if (file.type === 'folder') {
      setCurrentPath([...currentPath, file.name]);
      setSelectedFile(null);
    } else {
      setSelectedFile(file);
    }
  };

  const handleBackClick = () => {
    if (currentPath.length > 0) {
      setCurrentPath(currentPath.slice(0, -1));
      setSelectedFile(null);
    }
  };

  const renderFileList = () => {
    return (
      <FileListContainer>
        {currentPath.length > 0 && (
          <FileItem onClick={handleBackClick}>
            <FolderIcon>üìÅ</FolderIcon>..
          </FileItem>
        )}

        {currentFolder.children && currentFolder.children.map((item, index) => (
          <FileItem key={index} onClick={() => handleFileClick(item)}>
            {item.type === 'folder' ? (
              <>
                <FolderIcon>üìÅ</FolderIcon>
                {item.name}
              </>
            ) : (
              <>
                <FileIcon>üìÑ</FileIcon>
                {item.name}
              </>
            )}
          </FileItem>
        ))}
      </FileListContainer>
    );
  };

  return (
    <Container>
      <Header>
        <PathDisplay>
          /{currentPath.join('/')}
        </PathDisplay>
        <RefreshButton onClick={() => navigateToPath(currentPath)}>
          Refresh
        </RefreshButton>
      </Header>

      {!selectedFile ? (
        renderFileList()
      ) : (
        <>
          <FileListContainer style={{ flex: '0 0 auto', maxHeight: '30%' }}>
            <FileItem onClick={() => setSelectedFile(null)}>
              <FileIcon>‚Ü©Ô∏è</FileIcon>
              Back to files
            </FileItem>
          </FileListContainer>
          <FileContent>
            {selectedFile.content}
          </FileContent>
        </>
      )}
    </Container>
  );
};

export default FileViewer;
